import '../styles/style.css';
import React from "react";
import Logo from "../images/logo2.svg"
import NavBar from './NavBar';

function Header() {
  return (
    <header>
        <img src={Logo} alt="" />
        <NavBar/>
    </header>
  )
}

export default Header;
